import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input field by its placeholder and type 'iPhone'
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.waitFor({ state: 'visible' });
    await searchInput.fill('iPhone');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // 2. Locate the search button and click it
    // The first button with class 'search-btn' is the correct one
    const searchButton = page.locator('.search-btn').first();
    await searchButton.click();

    // 3. Wait for the search results to be displayed on the page
    // The script updates the DOM, so we wait for a specific element that indicates results are loaded.
    await page.waitForSelector('h2:has-text("Search Results for \\"iPhone\\"")');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 4. Extract data to verify the search was successful
    const resultsCountElement = page.locator('.results-count');
    const resultsCountText = await resultsCountElement.innerText();

    const productTitleElement = page.locator('.product-title:has-text("Apple iPhone 15 Pro Max")');
    const productTitle = await productTitleElement.innerText();

    return {
      success: true,
      action: "Searched for 'iPhone' and verified search results.",
      extractedData: {
        resultsCount: resultsCountText,
        foundProduct: productTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Capture a screenshot on failure to help with debugging
    try {
      await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
    } catch (e) {
      // Ignore if screenshot fails
    }
    return {
      success: false,
      action: "Failed to search for products",
      extractedData: {},
      screenshots: [path.join(screenshotsDir, 'error_screenshot.png')],
      error: error.message
    };
  }
}
